**Describe the bug**
To get the results I have tried these two:

```C#
using(var results = _session.Run(inputs))
{
    return results.First().AsEnumerable<float>().ToArray();
}
```

```C#
using(var results = _session.Run(inputs))
{
    return results.First().AsTensor<float>().ToDenseTensor();
}
```

I noticed that the latter is slower than the former, even though there seems to be a copy involved in both (?).

I first thought it is `ToDenseTensor` that has some copying overhead, but used 

```
using (var pin = (tensor as DenseTensor<float>).Buffer.Pin())
```

and still it was 60ms slower! which makes sense because `ToTensor` is already dense so `ToDenseTensor` according to documentation does not copy.

**System information**
- OS Platform and Distribution (e.g., Linux Ubuntu 16.04): Windows 10
- ONNX Runtime installed from (source or binary): nuget
- ONNX Runtime version: 0.3.0

**To Reproduce**
Install 0.3.0 and try consuming the results using `AsTensor` vs `AsEnumerable`

**Expected behavior**
Should be about the same runtime, unless Tensor object creation is heavy

**Additional context**
The final results size is 1000000 which is why copy matters at all

